import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  products: [],
  isPageLoading: false,
  isButtonLoading: false,
  itemCode: [],
  row:10
};

const itemSlice = createSlice({
  name: "items",
  initialState,
  reducers: {},
});
export default itemSlice;

export const getItemData = () => {
  return (dispatch) => {
    console.log("hi");
  };
};
